class Box {
   constructor(i,j){
      this.left = true;
      this.right = true;
      this.top = true;
      this.bottom = true;
      this.i=i;
      this.j=j;
   }
 }

var grid = []

for (let i = 0; i < 8; i++) {
   grid[i]=[]
   for (let j = 0; j < 8; j++) {
      grid[i][j]=new Box(i,j);
   }
}


export const myGrid = grid.map((x)=>x);
